class Solution(object):
    def addOperators(self, num, target):
        """
        :type num: str
        :type target: int
        :rtype: List[str]
        """

        def backtrack(i, curr, prev, prod, res):
            if i == len(num):
                if curr == target:
                    res.append(prev)
                return
            for j in range(i, len(num)):
                if j > i and num[i] == '0':
                    break
                curr = int(num[i:j+1])
                if prev == 0:
                    backtrack(j+1, curr, curr, curr, res)
                else:
                    backtrack(j+1, curr, prev + curr, prod + curr, res)
                    backtrack(j+1, curr, prev - curr, (prod - prev) + curr, res)
                    backtrack(j+1, curr, prev * curr, prod * curr, res)

        res = []
        backtrack(0, 0, 0, 0, res)
        return res

