class Solution(object):
    def canCompleteCircuit(self, gas, cost):
        """
        :type gas: List[int]
        :type cost: List[int]
        :rtype: int
        """

        ## 1. find the sum of gas and cost
        ## 2. if the sum is less than the sum of gas, return -1
        ## 3. if the sum is greater than the sum of gas, return 0
        ## 4. if the sum is equal to the sum of gas, return the index of the first station

        sum_gas = sum(gas)
        sum_cost = sum(cost)

        if sum_gas < sum_cost:
            return -1
        elif sum_gas == sum_cost:
            return 0
        else:
            for i in range(len(gas)):
                if gas[i] + sum_gas >= cost[i] + sum_cost:
                    return i
            return -1

