    def jump(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        n = len(nums)
        if n == 1:
            return 0

        if nums[0] >= n - 1:
            return 1

        if nums[0] == 0:
            return float('inf')

        dp = [float('inf')] * n
